CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "footballFieldManagement_campidacalcio" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "email" varchar(255) NOT NULL, "nomeCampo" varchar(100) NOT NULL, "orario_apertura" time NOT NULL, "orario_chiusura" time NOT NULL, "via" varchar(100) NOT NULL, "civico" integer NOT NULL, "citta" varchar(100) NOT NULL, "cap" varchar(5) NOT NULL, "telefono" varchar(10) NOT NULL, "prezzo_campo" real NOT NULL, "giorni_apertura" varchar(13) NOT NULL, "tipo_campo" varchar(5) NOT NULL, "longitudine" real NOT NULL, "latitudine" real NOT NULL, "image" varchar(100) NOT NULL, "chiuso" bool NULL);
