CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "accounts_userprofile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(30) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "ddn" date NOT NULL, "citta" varchar(100) NOT NULL, "telefono" varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS "accounts_userprofile_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "userprofile_id" integer NOT NULL REFERENCES "accounts_userprofile" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_userprofile_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "userprofile_id" integer NOT NULL REFERENCES "accounts_userprofile" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_utentiregistrati" ("userprofile_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "accounts_userprofile" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_proprietario" ("userprofile_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "accounts_userprofile" ("id") DEFERRABLE INITIALLY DEFERRED, "p_iva" varchar(11) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "accounts_proprietario_possiedeCampi" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "proprietario_id" integer NOT NULL REFERENCES "accounts_proprietario" ("userprofile_ptr_id") DEFERRABLE INITIALLY DEFERRED, "campidacalcio_id" integer NOT NULL REFERENCES "footballFieldManagement_campidacalcio" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "accounts_userprofile" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "bookingFootballField_payment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stripe_charge_id" varchar(50) NOT NULL, "timestamp" date NOT NULL, "prezzo" real NOT NULL, "cliente_id" integer NULL REFERENCES "accounts_utentiregistrati" ("userprofile_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bookingFootballField_review" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "voto" integer NOT NULL, "campo_id" integer NOT NULL REFERENCES "footballFieldManagement_campidacalcio" ("id") DEFERRABLE INITIALLY DEFERRED, "utente_id" integer NOT NULL REFERENCES "accounts_utentiregistrati" ("userprofile_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "bookingFootballField_pendingreservation" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "data" date NOT NULL, "ora" time NOT NULL, "accettato" bool NULL, "campo_id" integer NOT NULL REFERENCES "footballFieldManagement_campidacalcio" ("id") DEFERRABLE INITIALLY DEFERRED, "cliente_id" integer NULL REFERENCES "accounts_utentiregistrati" ("userprofile_ptr_id") DEFERRABLE INITIALLY DEFERRED, "payment_id" integer NULL REFERENCES "bookingFootballField_payment" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
